	(156, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'La empresa piscícola o el productor asiste a eventos públicos como:', 'Participa en giras y congresos internacionales del gremio Acuícola', 4, '1.5.1.1'),
	(157, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'La empresa piscícola o el productor asiste a eventos públicos como:', 'Participación en congresos, asambleas, giras nacionales, reuniones acuícolas y en negocios internacionales', 3, '1.5.1.1'),
	(158, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'La empresa piscícola o el productor asiste a eventos públicos como:', 'Participación en espacios institucionales, sociales y políticos no son su prioridad', 2, '1.5.1.1'),
	(159, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'La empresa piscícola o el productor asiste a eventos públicos como:', 'Apatía a ejercer liderazgos ante la comunidad y las entidades', 1, '1.5.1.1'),
	(160, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Conocimiento sobre herramientas para la participación', 'Reconoce las herramientas de participación, su alcance y aplicabilidad', 4, '1.5.2.1'),
	(161, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Conocimiento sobre herramientas para la participación', 'Reconoce las herramientas de participación y sus alcances, pero no su aplicabilidad', 3, '1.5.2.1'),
	(162, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Conocimiento sobre herramientas para la participación', 'Reconoce las herramientas de participación, pero desconoce su alcance y aplicabilidad', 2, '1.5.2.1'),
	(163, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Conocimiento sobre herramientas para la participación', 'Desconoce las herramientas de participación', 1, '1.5.2.1'),
	(164, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Ejercicio de control político y social', 'Entiende en que consiste el control social, así como las herramientas que lo permiten, su alcance y su aplicabilidad', 4, '1.5.3.1'),
	(165, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Ejercicio de control político y social', 'Entiende en que consiste el control social y conoce las herramientas con que se cuenta para realizarlo, pero desconoce su alcance y aplicabilidad', 3, '1.5.3.1'),
	(166, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Ejercicio de control político y social', 'Conoce que es el control social, pero desconoce las herramientas con que se cuenta para realizarlo', 2, '1.5.3.1'),
	(167, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Ejercicio de control político y social', 'Desconoce lo que es el control social y las herramientas con que se puede realizar', 1, '1.5.3.1'),
	(168, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'dentro de sus actividades productivas la comunidad a la que pertenece', ' Están conformados como cooperativas de producción u otra figura asociativa formal o empresa privada', 4, '1.5.4.1'),
	(169, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'dentro de sus actividades productivas la comunidad a la que pertenece', ' No se encuentran conformados legalmente bajo una figura asociativa, pero si se encuentran agrupados en la Junta de Acción Comunal (JAC), sin embargo, dentro de la comunidad existen actividades de trabajo social y recolección de recursos para intereses colectivos', 3, '1.5.4.1'),
	(170, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'dentro de sus actividades productivas la comunidad a la que pertenece', 'Solo Cuenta con la vinculación a las Juntas de Acción Comunal, su junta directiva es la encargada de gestionar recursos y liderar procesos', 2, '1.5.4.1'),
	(171, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'dentro de sus actividades productivas la comunidad a la que pertenece', 'Se encuentran vinculados por la Junta de Acción Comunal, pero no presenta acciones de gestión', 1, '1.5.4.1');
INSERT INTO `topc_anexo4preguntas` (`a4op_a4op`, `a4op_capitulo`, `a4op_pregunta`, `a4op_opciones`, `a4op_valor`, `a4op_codigo`) VALUES
	(1, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'La actividad forestal, teniendo en cuenta la extensión de su predio, ocupa un área', 'Igual o superior al 75%', 4, '1.1.1.1'),
	(2, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'La actividad forestal, teniendo en cuenta la extensión de su predio, ocupa un área', 'Entre el 74% y 50%', 3, '1.1.1.1'),
	(3, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'La actividad forestal, teniendo en cuenta la extensión de su predio, ocupa un área', 'Entre el 49% y el 25%', 2, '1.1.1.1'),
	(4, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'La actividad forestal, teniendo en cuenta la extensión de su predio, ocupa un área', 'Inferior al 24%', 1, '1.1.1.1'),
	(5, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Teniendo en cuenta el uso y vocación de su predio, así como las coberturas vegetales que lo componen, usted', 'Realiza planificación predial (en el entendido que lo realiza de forma integral: producción, recursos naturales e infraestructura)', 4, '1.1.1.2'),
	(6, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Teniendo en cuenta el uso y vocación de su predio, así como las coberturas vegetales que lo componen, usted', 'Contempla solamente las áreas productivas de su predio', 3, '1.1.1.2'),
	(7, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Teniendo en cuenta el uso y vocación de su predio, así como las coberturas vegetales que lo componen, usted', 'Solo se contempla el área donde el área donde se realiza la producción principal', 2, '1.1.1.2'),
	(8, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Teniendo en cuenta el uso y vocación de su predio, así como las coberturas vegetales que lo componen, usted', 'No contempla una planeación del predio', 1, '1.1.1.2'),
	(9, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'El recurso forestal es empleado con fines comerciales (bien o servicio), provenientes de', 'En su totalidad de plantación forestal', 4, '1.1.1.3'),
	(10, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'El recurso forestal es empleado con fines comerciales (bien o servicio), provenientes de', 'En su totalidad de bosque natural', 3, '1.1.1.3'),
	(11, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'El recurso forestal es empleado con fines comerciales (bien o servicio), provenientes de', 'En plantación forestal y bosque natural', 1, '1.1.1.3'),
	(12, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'El material vegetal (semilla) empleado para el aprovechamiento proviene de', 'Material vegetal certificado', 4, '1.1.1.4'),
	(13, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'El material vegetal (semilla) empleado para el aprovechamiento proviene de', 'Material vegetal recolectado y seleccionado de áreas ya establecidas', 3, '1.1.1.4'),
	(14, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'El material vegetal (semilla) empleado para el aprovechamiento proviene de', 'Material vegetal recolectado, pero sin proceso de selección de procedencia', 2, '1.1.1.4'),
	(15, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'El material vegetal (semilla) empleado para el aprovechamiento proviene de', 'Regeneración natural', 1, '1.1.1.4'),
	(16, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Los productos o servicios obtenidos del aprovechamiento del bosque que le generan rentabilidad económica son', 'Madera (aserrada, rolliza, leña y carbón)', 4, '1.1.1.5'),
	(17, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Los productos o servicios obtenidos del aprovechamiento del bosque que le generan rentabilidad económica son', 'No maderables (resinas, frutos, fibras, cortezas, látex, entre otros)', 3, '1.1.1.5'),
	(18, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Los productos o servicios obtenidos del aprovechamiento del bosque que le generan rentabilidad económica son', 'Pago por servicios ambientales (incluido lo destinado al turismo)', 2, '1.1.1.5'),
	(19, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Los productos o servicios obtenidos del aprovechamiento del bosque que le generan rentabilidad económica son', 'Se alternan al menos dos (2) de las actividades anteriormente mencionadas', 1, '1.1.1.5'),
	(20, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Sus actividades agropecuarias complementarias abarcan', 'Menor al 25%', 4, '1.1.2.1'),
	(21, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Sus actividades agropecuarias complementarias abarcan', 'Entre el 26% y el 50%', 3, '1.1.2.1'),
	(22, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Sus actividades agropecuarias complementarias abarcan', 'Entre el 51% y 75%', 2, '1.1.2.1'),
	(23, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Sus actividades agropecuarias complementarias abarcan', 'Mayor al 75%', 1, '1.1.2.1'),
	(24, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'las herramientas empleadas son:', 'Skiders, arrastradores, autocargardores', 4, '1.1.3.1'),
	(25, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'las herramientas empleadas son:', 'Mecánicas (Motosierras, sierras, guadañas, entre otros)', 3, '1.1.3.1'),
	(26, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'las herramientas empleadas son:', 'Manuales (Hachas, machetes, sierras, tijeras, entre otros)', 1, '1.1.3.1'),
	(27, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'El transporte de la materia prima obtenida o extracción del producto, al centro de acopio o de transformación se realiza mediante', 'Tractores, cables aéreos u otro medio mecánico de gran capacidad', 4, '1.1.3.2'),
	(28, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'El transporte de la materia prima obtenida o extracción del producto, al centro de acopio o de transformación se realiza mediante', 'Mediante el uso de tracción animal (mula, caballos, bueyes, búfalos)', 3, '1.1.3.2'),
	(29, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'El transporte de la materia prima obtenida o extracción del producto, al centro de acopio o de transformación se realiza mediante', 'No se requiere la utilización de medios de trasporte', 1, '1.1.3.2'),
	(30, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Los instrumentos o equipos empleados como unidad de medida para el aprovechamiento del recurso se encuentran', 'Calibrados desde la casa fabricante', 4, '1.1.3.3'),
	(31, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Los instrumentos o equipos empleados como unidad de medida para el aprovechamiento del recurso se encuentran', 'Son calibrados a partir de instrumentos semejantes por parte del productor', 3, '1.1.3.3'),
	(32, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Los instrumentos o equipos empleados como unidad de medida para el aprovechamiento del recurso se encuentran', 'Los productos obtenidos se emplean como unidad de medida', 2, '1.1.3.3'),
	(33, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Los instrumentos o equipos empleados como unidad de medida para el aprovechamiento del recurso se encuentran', 'No se cuenta con instrumentos ni herramientas que permitan homogenizar las medidas de los productos', 1, '1.1.3.3'),
	(34, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Acerca del uso de los elementos de seguridad industrial en  el aprovechamiento del recurso forestal.', 'Los conoce y emplea todos', 4, '1.1.4.1'),
	(35, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Acerca del uso de los elementos de seguridad industrial en  el aprovechamiento del recurso forestal.', 'Los conoce y emplea parcialmente ', 3, '1.1.4.1'),
	(36, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Acerca del uso de los elementos de seguridad industrial en  el aprovechamiento del recurso forestal.', 'Los conoce pero no los emplea', 2, '1.1.4.1'),
	(37, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Acerca del uso de los elementos de seguridad industrial en  el aprovechamiento del recurso forestal.', 'Los desconoce', 1, '1.1.4.1'),
	(38, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Durante el proceso de aprovechamiento, se realiza procesos de señalización de áreas en cuanto a', 'Todas las áreas de recolección, apeado, trozado, descortezado, avistamiento y demás zonas del proceso', 4, '1.1.4.2'),
	(39, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Durante el proceso de aprovechamiento, se realiza procesos de señalización de áreas en cuanto a', 'Se cuenta con la señalización y demarcación en algunas áreas de trabajo designadas', 3, '1.1.4.2'),
	(40, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Durante el proceso de aprovechamiento, se realiza procesos de señalización de áreas en cuanto a', 'Se cuenta con alguna señalización en las áreas de trabajo designada', 2, '1.1.4.2'),
	(41, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Durante el proceso de aprovechamiento, se realiza procesos de señalización de áreas en cuanto a', 'No se cuenta con la señalización, ni demarcación de ninguna área de trabajo', 1, '1.1.4.2'),
	(42, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Los residuos producidos durante el proceso de aprovechamiento forestal son:', 'Son recolectados y clasificados en sitio y llevados hasta el centro de acopio para su disposición', 4, '1.1.4.3'),
	(43, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Los residuos producidos durante el proceso de aprovechamiento forestal son:', 'Son recolectados en el sitio y clasificados en el centro de acopio para su disposición', 3, '1.1.4.3'),
	(44, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Los residuos producidos durante el proceso de aprovechamiento forestal son:', 'Son recolectados en el sitio y llevados hasta el centro de acopio para su disposición, sin ser clasificados', 2, '1.1.4.3'),
	(45, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Los residuos producidos durante el proceso de aprovechamiento forestal son:', 'Son abandonados en el sitio', 1, '1.1.4.3'),
	(46, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Esquemas de comercialización de los productos', 'Se cuenta con un comprador o comercialización que garantiza la compra de una cantidad constant El productor aprovecha y realiza algún tipo de transformación', 4, '1.1.5.1'),
	(47, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Esquemas de comercialización de los productos', 'Se cuenta con un mercado o comprados, pero esta se encuentra sujeta a los requerimientos de volumen que este realic El productor aprovecha y realiza algún tipo de transformación', 3, '1.1.5.1'),
	(48, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Esquemas de comercialización de los productos', 'El comprador o comercializador adquiere el turno o producto a recolectar en el predio siendo él el encargado de aprovechar y transformar', 2, '1.1.5.1'),
	(49, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Esquemas de comercialización de los productos', 'No se cuenta con un comprador fijo, el productor aprovecha y comercializa al mayor o detal dependiendo la oferta y demanda', 1, '1.1.5.1'),
	(50, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Los productos o servicios obtenidos del aprovechamiento forestal cuentan con:', 'Mercados especializados ya establecidos que garantizan su compra, con calidad ya establecida', 4, '1.1.6.1'),
	(51, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Los productos o servicios obtenidos del aprovechamiento forestal cuentan con:', 'Mercados especializados emergentes que fluctúa el volumen y calidad del producto', 3, '1.1.6.1'),
	(52, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Los productos o servicios obtenidos del aprovechamiento forestal cuentan con:', 'Mercados generales que diversifican la calidad de los productos', 2, '1.1.6.1'),
	(53, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Los productos o servicios obtenidos del aprovechamiento forestal cuentan con:', 'No se cuenta con mercados definidos que garanticen la comercialización del productor de forma continua', 1, '1.1.6.1'),
	(54, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Una vez establecidos los mercados destino de los productos o servicio que se obtengan del aprovechamiento, los precios son establecidos en cuanto a:', 'Los precios son establecidos previamente a la cosecha, recolección o aprovechamiento, cumpliendo las características de calidad y cantidad dispuestos por los compradores y adoptados por el productor', 1, '1.1.6.2'),
	(55, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Una vez establecidos los mercados destino de los productos o servicio que se obtengan del aprovechamiento, los precios son establecidos en cuanto a:', 'Los precios son establecidos en el momento de la cosecha, recolección o aprovechamiento teniendo en cuenta la oferta y demanda por parte del comercializador', 3, '1.1.6.2'),
	(56, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Una vez establecidos los mercados destino de los productos o servicio que se obtengan del aprovechamiento, los precios son establecidos en cuanto a:', 'Los precios están sujetos al momento de la transacción o venta', 1, '1.1.6.2'),
	(57, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Posterior a la extracción o cosecha de los productos o servicios generados por el aprovechamiento forestal, a estos se les realiza:', 'La transformación de la materia prima está acompañada de marca propia, empaque, permisos de INVIMA, ICA u otra que requiera y posicionamiento de mercado', 4, '1.1.7.1'),
	(58, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Posterior a la extracción o cosecha de los productos o servicios generados por el aprovechamiento forestal, a estos se les realiza:', 'Procesos de transformación, cuenta con marca propia y empaque, pero no se tienen los permisos pertinentes o se encuentra en proceso', 3, '1.1.7.1'),
	(59, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Posterior a la extracción o cosecha de los productos o servicios generados por el aprovechamiento forestal, a estos se les realiza:', 'La transformación de los productos, pero no cuentan con marca propia, empaque ni permisos pertinentes', 2, '1.1.7.1'),
	(60, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Posterior a la extracción o cosecha de los productos o servicios generados por el aprovechamiento forestal, a estos se les realiza:', 'No se realiza la transformación de los productos', 1, '1.1.7.1'),
	(61, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Durante el desarrollo de la actividad productiva, el productor cuenta con', 'Registros de comportamiento de la actividad (producción, mantenimiento, desarrollo, ventas, entre otros) de forma periódica que permita realizar análisis', 4, '1.1.8.1'),
	(62, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Durante el desarrollo de la actividad productiva, el productor cuenta con', 'Registros de producción de forma permanente (producción y ventas)', 3, '1.1.8.1'),
	(63, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Durante el desarrollo de la actividad productiva, el productor cuenta con', 'Se cuentan con registro de forma esporádica', 2, '1.1.8.1'),
	(64, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Durante el desarrollo de la actividad productiva, el productor cuenta con', 'No se llevan registros de la actividad', 1, '1.1.8.1'),
	(65, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'El personal está calificado y certificado', 'Calificado y certificado', 4, '1.1.9.1'),
	(66, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'El personal está calificado y certificado', 'No está capacitado ni certificado PERO tiene más de 3 años de experiencia específica en el sector forestal', 3, '1.1.9.1'),
	(67, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'El personal está calificado y certificado', 'No está capacitado ni certificado Y tiene menos de 3 años de experiencia específica en el sector forestal', 2, '1.1.9.1'),
	(68, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'El personal está calificado y certificado', 'Ni capacitado ni certificado ni con experiencia', 1, '1.1.9.1'),
	(69, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Dentro de las actividades de aprovechamiento forestal usted:', 'Ha accedido a certificado de incentivo forestal (CIF)', 4, '1.1.10.1'),
	(70, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Dentro de las actividades de aprovechamiento forestal usted:', 'No ha accedido a certificado de incentivo forestal (CIF)', 1, '1.1.10.1'),
	(71, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'El productor se encuentra', 'Bancarizado (Cuenta de ahorros, corriente o tarjeta de crédito)', 4, '1.1.10.2'),
	(72, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'El productor se encuentra', 'No bancarizado', 1, '1.1.10.2'),
	(73, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Sobre créditos bancarios', 'Tramitado y ha sido aprobado un crédito bancario', 4, '1.1.10.3'),
	(74, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Sobre créditos bancarios', 'Ha tramitado, pero no fue aprobado por la entidad bancaria el crédito', 3, '1.1.10.3'),
	(75, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Sobre créditos bancarios', 'Aunque conoce la oferta de las entidades bancaria, no ha solicitado créditos del sector', 2, '1.1.10.3'),
	(76, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', 'Sobre créditos bancarios', 'Desconoce el portafolio de servicios bancarios para los créditos del sector', 1, '1.1.10.3'),
	(77, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', '¿Dentro del sector forestal, el productor conoce los incentivos con que se cuenta el sector forestal?, como es el caso de FINAGRO.', 'Conoce y entiende los incentivos económicos al sector forestal', 4, '1.1.10.4'),
	(78, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', '¿Dentro del sector forestal, el productor conoce los incentivos con que se cuenta el sector forestal?, como es el caso de FINAGRO.', 'Conoce los incentivos económicos al sector forestal, pero no reconoce los mecanismos para acceder', 3, '1.1.10.4'),
	(79, 'DESARROLLO DE CAPACIDADES HUMANAS Y TECNICAS', '¿Dentro del sector forestal, el productor conoce los incentivos con que se cuenta el sector forestal?, como es el caso de FINAGRO.', 'Desconoce los incentivos económicos al sector forestal', 1, '1.1.10.4'),
	(80, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'El productor se encuentra vinculado a alguna de las siguientes formas asociativas', 'Gremio (Nivel regional o nacional)', 4, '1.2.1.1'),
	(81, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'El productor se encuentra vinculado a alguna de las siguientes formas asociativas', 'Alguna figura asociativa a nivel veredal, municipal o departamental', 3, '1.2.1.1'),
	(82, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'El productor se encuentra vinculado a alguna de las siguientes formas asociativas', 'Juntas de acción comunal', 2, '1.2.1.1'),
	(83, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'El productor se encuentra vinculado a alguna de las siguientes formas asociativas', 'No se encuentra vinculado a ninguna figura asociativa', 1, '1.2.1.1'),
	(84, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Durante las actividades que componen el aprovechamiento forestal, son llevadas a cabo mediante', 'De forma comunitaria, se suplen las necesidades de mano de obra y alternativas comerciales de los productores del sector forestal', 4, '1.2.2.1'),
	(85, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Durante las actividades que componen el aprovechamiento forestal, son llevadas a cabo mediante', 'Las actividades de mantenimiento y aprovechamiento forestal de forma comunitaria, entre los productores asociados u organizados', 3, '1.2.2.1'),
	(86, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Durante las actividades que componen el aprovechamiento forestal, son llevadas a cabo mediante', 'Las actividades de transformación y/o comerciales se realizan de forma comunitaria entre los productores asociados u organizados', 2, '1.2.2.1'),
	(87, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Durante las actividades que componen el aprovechamiento forestal, son llevadas a cabo mediante', 'Las actividades del aprovechamiento, transformación y/o comercialización,son realizadas por el productor, su núcleo familiar o personal contratado', 1, '1.2.2.1'),
	(88, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'A partir de los procesos asociativos o individuales en los que está inmerso el productor', 'Se han generado nuevas apuestas asociativas que conllevaron a proyectos de emprendimientos', 4, '1.2.3.1'),
	(89, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'A partir de los procesos asociativos o individuales en los que está inmerso el productor', ' Dentro de las figuras de carácter asociativo existentes y de los cuales es miembro se han consolidado proyectos de emprendimiento', 3, '1.2.3.1'),
	(90, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'A partir de los procesos asociativos o individuales en los que está inmerso el productor', 'Usted como productor individual a generado proyectos de emprendimiento', 2, '1.2.3.1'),
	(91, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'A partir de los procesos asociativos o individuales en los que está inmerso el productor', 'No hace parte de ninguna apuesta de carácter asociativo y no genera procesos de emprendimiento', 1, '1.2.3.1'),
	(92, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'A partir de sus procesos asociativos, comunitarios o individuales, y con el propósito de garantizar acceso a nuevos mercados y garantizar precios competitivos se generan', 'Alianzas de carácter comercial, que garantizan comprador, distribución y precios, con actores de nivel nacional y regional', 4, '1.2.4.1'),
	(93, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'A partir de sus procesos asociativos, comunitarios o individuales, y con el propósito de garantizar acceso a nuevos mercados y garantizar precios competitivos se generan', 'Alianzas de carácter comercial, que garantizan comprador y precios, con actores de nivel local', 3, '1.2.4.1'),
	(94, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'A partir de sus procesos asociativos, comunitarios o individuales, y con el propósito de garantizar acceso a nuevos mercados y garantizar precios competitivos se generan', 'Alianzas o acuerdos de compra, que generan la posibilidad de comercialización de los productos, pero que se definen en cuanto a volumen y precios en el momento de producción', 2, '1.2.4.1'),
	(95, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'A partir de sus procesos asociativos, comunitarios o individuales, y con el propósito de garantizar acceso a nuevos mercados y garantizar precios competitivos se generan', 'No se cuenta con aliados estratégicos para la comercialización', 1, '1.2.4.1'),
	(96, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Dentro de la asistencia técnica o extensión agropecuaria, que requiere el aprovechamiento forestal esta es de forma', 'Continúa, brindada por personal idóneo del gremio, UMATA, Ministerio de Agricultura, ADR', 4, '1.2.5.1'),
	(97, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Dentro de la asistencia técnica o extensión agropecuaria, que requiere el aprovechamiento forestal esta es de forma', 'Temporal, brindada por personal idóneo pagada por el productor o la asociación', 3, '1.2.5.1'),
	(98, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Dentro de la asistencia técnica o extensión agropecuaria, que requiere el aprovechamiento forestal esta es de forma', 'Temporal, brindada por personal idóneo proveniente del gremio, asociación, municipio o el Ministerio de Agricultura, ADR', 2, '1.2.5.1'),
	(99, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Dentro de la asistencia técnica o extensión agropecuaria, que requiere el aprovechamiento forestal esta es de forma', 'No se cuenta con acompañamiento técnico', 1, '1.2.5.1'),
	(100, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Dentro del proceso de asistencias técnica o extensión agropecuaria brindada para la línea productiva forestal, este se encuentra acompañado por', 'Visitas personalizadas y al menos tres métodos grupales y se cuenta con material de consulta para cada productor', 4, '1.2.5.2'),
	(101, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Dentro del proceso de asistencias técnica o extensión agropecuaria brindada para la línea productiva forestal, este se encuentra acompañado por', 'Visitas personalizadas y al menos un método grupal y se cuenta con material de consulta para cada productor', 3, '1.2.5.2'),
	(102, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Dentro del proceso de asistencias técnica o extensión agropecuaria brindada para la línea productiva forestal, este se encuentra acompañado por', 'Visitas personalizadas y se cuenta con material de consulta para cada productor', 2, '1.2.5.2'),
	(103, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Dentro del proceso de asistencias técnica o extensión agropecuaria brindada para la línea productiva forestal, este se encuentra acompañado por', 'Solo se realizan visitas personalizadas', 1, '1.2.5.2'),
	(104, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'de los 6 ejes temáticos (Producción, mantenimiento, manejo       sanitario, buenas       prácticas, comercialización     y asociatividad.) cuántos brinda la extensión agropecuaria', '6 ejes temáticos', 4, '1.2.5.3'),
	(105, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'de los 6 ejes temáticos (Producción, mantenimiento, manejo       sanitario, buenas       prácticas, comercialización     y asociatividad.) cuántos brinda la extensión agropecuaria', '4 ejes temáticos', 3, '1.2.5.3'),
	(106, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'de los 6 ejes temáticos (Producción, mantenimiento, manejo       sanitario, buenas       prácticas, comercialización     y asociatividad.) cuántos brinda la extensión agropecuaria', '2 ejes temáticos', 2, '1.2.5.3'),
	(107, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'de los 6 ejes temáticos (Producción, mantenimiento, manejo       sanitario, buenas       prácticas, comercialización     y asociatividad.) cuántos brinda la extensión agropecuaria', '1 eje temático', 1, '1.2.5.3'),
	(108, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Cuántos de los 5 aspectos cumple la extensión agropecuaria', 'Los cinco (5) aspectos', 4, '1.2.5.4'),
	(109, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Cuántos de los 5 aspectos cumple la extensión agropecuaria', 'Cuatro (4) de los cinco (5) aspectos', 3, '1.2.5.4'),
	(110, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Cuántos de los 5 aspectos cumple la extensión agropecuaria', 'Tres (3) de los cinco aspectos', 2, '1.2.5.4'),
	(111, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Cuántos de los 5 aspectos cumple la extensión agropecuaria', 'Dos (2) o menos de los cinco (5) aspectos', 1, '1.2.5.4'),
	(112, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Uso de sellos de calidad y certificaciones', 'Tiene conocimiento de la importancia de estar certificado en calidad, origen y sello verde, y ya cuenta con al menos uno (1) de estos', 4, '1.2.6.1'),
	(113, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Uso de sellos de calidad y certificaciones', 'Tiene conocimiento de la importancia de estar certificado en calidad, origen y sello verde y ha iniciado el proceso para acceder a estos', 3, '1.2.6.1'),
	(114, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Uso de sellos de calidad y certificaciones', 'Tiene conocimiento de la importancia de estar certificado en calidad, origen y sello verde, pero no ha iniciado el proceso para acceder a estos', 2, '1.2.6.1'),
	(115, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Uso de sellos de calidad y certificaciones', 'No tiene conocimiento de la importancia de acceder y certificarse para acceder a estos', 1, '1.2.6.1'),
	(116, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'A partir del valor agregado que se generan a los productos y servicios, dentro de su sistema productivo, usted cuenta con', 'Sello o certificado de calidad, certificado de origen y sello verde', 4, '1.2.6.2'),
	(117, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'A partir del valor agregado que se generan a los productos y servicios, dentro de su sistema productivo, usted cuenta con', 'Dos (2) de los siguientes sellos o certificados (calidad, origen o verde)', 3, '1.2.6.2'),
	(118, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'A partir del valor agregado que se generan a los productos y servicios, dentro de su sistema productivo, usted cuenta con', 'Uno (1) de los siguientes sellos o certificados (calidad, origen o verde)', 2, '1.2.6.2'),
	(119, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'A partir del valor agregado que se generan a los productos y servicios, dentro de su sistema productivo, usted cuenta con', 'NO cuenta con sello certificado de calidad, origen o verde', 1, '1.2.6.2'),
	(120, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Cuáles características tienen los productos o servicios que usted genera dentro del aprovechamiento forestal', 'Son innovadores y no existe en el mercado un producto de similares características', 4, '1.2.7.1'),
	(121, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Cuáles características tienen los productos o servicios que usted genera dentro del aprovechamiento forestal', 'Poseen valor agregado que suplen productos ya existentes', 3, '1.2.7.1'),
	(122, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Cuáles características tienen los productos o servicios que usted genera dentro del aprovechamiento forestal', 'Tienen características similares a los productos ya existentes, pero son competitivos en cuanto a valor', 2, '1.2.7.1'),
	(123, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Cuáles características tienen los productos o servicios que usted genera dentro del aprovechamiento forestal', 'Son iguales a productos ya existentes con condiciones de comercialización iguales (precio, mercado y distribución)', 1, '1.2.7.1'),
	(124, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Tiene conocimiento respecto de las normas que regulan la propiedad intelectual y sus productos cuentan con algún tipo de certificado asociado', 'Se tiene conocimiento de las normas que regulan la propiedad intelectual y se cuenta con productos con este certificado', 4, '1.2.7.2'),
	(125, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Tiene conocimiento respecto de las normas que regulan la propiedad intelectual y sus productos cuentan con algún tipo de certificado asociado', 'Se tiene conocimiento de las normas que regulan la propiedad intelectual pero no se cuenta con productos con este certificado', 3, '1.2.7.2'),
	(126, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Tiene conocimiento respecto de las normas que regulan la propiedad intelectual y sus productos cuentan con algún tipo de certificado asociado', 'No se cuenta con conocimiento de las normas que regulan la propiedad intelectual, se cuenta con productos nuevos para el mercado', 2, '1.2.7.2'),
	(127, 'DESARROLLO DE CAPACIDADES SOCIALES INTEGRALES Y EL FORTALECIMIENTO DE LA ASOCIATIVIDAD', 'Tiene conocimiento respecto de las normas que regulan la propiedad intelectual y sus productos cuentan con algún tipo de certificado asociado', 'No se cuenta con conocimiento de las normas que regulan', 1, '1.2.7.2'),
	(128, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Acceso a fuentes de información', 'Tiene acceso total a esta información', 1, '1.3.1.1'),
	(129, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Acceso a fuentes de información', 'Tiene acceso parcial a la información', 3, '1.3.1.1'),
	(130, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Acceso a fuentes de información', 'No tiene acceso a la información', 1, '1.3.1.1'),
	(131, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Acceso a las TIC', 'Tiene acceso a mínimo cinco (5) herramientas de información y comunicación', 4, '1.3.2.1'),
	(132, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Acceso a las TIC', 'Tiene acceso a mínimo tres (3) herramientas de información y comunicación', 3, '1.3.2.1'),
	(133, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Acceso a las TIC', 'Tiene acceso a mínimo una (1) herramienta de información y comunicación', 2, '1.3.2.1'),
	(134, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Acceso a las TIC', 'No tiene acceso a herramientas de información y comunicación', 1, '1.3.2.1'),
	(135, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Uso de las TIC como herramientas de toma de decisiones', 'Siempre', 4, '1.3.3.1'),
	(136, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Uso de las TIC como herramientas de toma de decisiones', 'Casi Siempre', 3, '1.3.3.1'),
	(137, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Uso de las TIC como herramientas de toma de decisiones', 'Muy poco', 2, '1.3.3.1'),
	(138, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Uso de las TIC como herramientas de toma de decisiones', 'Nunca', 1, '1.3.3.1'),
	(139, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Habilidades y competencias en el uso de TIC', 'Maneja plenamente las herramientas existentes y conoce las fuentes de información', 4, '1.3.4.1'),
	(140, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Habilidades y competencias en el uso de TIC', 'Maneja parcialmente las herramientas existentes, pero conoce las fuentes de información', 3, '1.3.4.1'),
	(141, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Habilidades y competencias en el uso de TIC', 'Maneja parcialmente las herramientas existentes y desconoce las fuentes de información', 2, '1.3.4.1'),
	(142, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Habilidades y competencias en el uso de TIC', 'No maneja las herramientas existentes', 1, '1.3.4.1'),
	(143, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Apropiación social del conocimiento tradicional y científico', 'Acoge tanto los conocimientos tradicionales como técnicos para optimizar sus procesos', 4, '1.3.5.1'),
	(144, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Apropiación social del conocimiento tradicional y científico', 'Da mayor relevancia a los conocimientos técnicos que a los tradicionales', 3, '1.3.5.1'),
	(145, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Apropiación social del conocimiento tradicional y científico', 'Da mayor relevancia a los conocimientos tradicionales que a los científicos', 2, '1.3.5.1'),
	(146, 'ACCESO A LA INFORMACIÒN Y USO DE LAS TIC', 'Apropiación social del conocimiento tradicional y científico', 'Únicamente pone en práctica los conocimientos tradicionales', 1, '1.3.5.1'),
	(147, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'Para el aprovechamiento del recurso forestal usted:', 'Cuenta con Plan de Manejo Forestal', 4, '1.4.1.1'),
	(148, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'Para el aprovechamiento del recurso forestal usted:', 'No cuenta con Plan de Manejo Forestal', 1, '1.4.1.1'),
	(149, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'Teniendo en cuenta las actividades que conllevan el aprovechamiento del recurso forestal, usted', 'Cuenta con Plan de Manejo Ambiental', 4, '1.4.1.2'),
	(150, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'Teniendo en cuenta las actividades que conllevan el aprovechamiento del recurso forestal, usted', 'Solo contempla las medidas de manejo ambientales para cada una de las actividades realizadas', 3, '1.4.1.2'),
	(151, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'Teniendo en cuenta las actividades que conllevan el aprovechamiento del recurso forestal, usted', 'Solo contempla la compensación ambiental para las actividades realizadas', 2, '1.4.1.2'),
	(152, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'Teniendo en cuenta las actividades que conllevan el aprovechamiento del recurso forestal, usted', 'Aunque conoce los impactos ambientales que genera sus actividades, con contempla ninguna medida de manejo para estos', 1, '1.4.1.2'),
	(153, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'A partir de los residuos vegetales que conlleva las actividades de aprovechamiento del recurso forestal usted:', 'Recolecta y transforma en abonos', 4, '1.4.2.1'),
	(154, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'A partir de los residuos vegetales que conlleva las actividades de aprovechamiento del recurso forestal usted:', 'Dispone en sitio para su descomposición, como aporte de materia orgánica', 3, '1.4.2.1'),
	(155, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'A partir de los residuos vegetales que conlleva las actividades de aprovechamiento del recurso forestal usted:', 'Recolecta en un sitio específico, pero no son aprovechados en las actividades que realiza', 2, '1.4.2.1'),
	(156, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'A partir de los residuos vegetales que conlleva las actividades de aprovechamiento del recurso forestal usted:', 'Realiza quema de residuos', 1, '1.4.2.1'),
	(157, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'Dentro del desarrollo de las actividades para el aprovechamiento del recurso forestal y en pro de generar procesos sostenibles realizo la protección de los recursos naturales agua, aire, suelo, fauna y flora, usted', 'Realizo protección de los cinco (5) recursos', 4, '1.4.2.2'),
	(158, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'Dentro del desarrollo de las actividades para el aprovechamiento del recurso forestal y en pro de generar procesos sostenibles realizo la protección de los recursos naturales agua, aire, suelo, fauna y flora, usted', 'Realizo la protección de al menos tres (3) recursos', 3, '1.4.2.2'),
	(159, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'Dentro del desarrollo de las actividades para el aprovechamiento del recurso forestal y en pro de generar procesos sostenibles realizo la protección de los recursos naturales agua, aire, suelo, fauna y flora, usted', 'Realizo la protección de al menos un (1) recurso', 2, '1.4.2.2'),
	(160, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'Dentro del desarrollo de las actividades para el aprovechamiento del recurso forestal y en pro de generar procesos sostenibles realizo la protección de los recursos naturales agua, aire, suelo, fauna y flora, usted', 'No realizo la protección de los recursos naturales', 1, '1.4.2.2'),
	(161, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'Dentro de los métodos de adaptación al cambio climático', 'Utiliza estrategias de adaptación al cambio climático y variabilidad climática', 4, '1.4.3.1'),
	(162, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'Dentro de los métodos de adaptación al cambio climático', 'No utiliza estrategias de adaptación al cambio climático y variabilidad climática', 1, '1.4.3.1'),
	(163, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'Dentro de sus actividades que conlleva dentro del aprovechamiento del recurso forestal y teniendo en cuenta la normatividad vigente usted', 'Reconoce y aplica la normatividad ambiental vigente, contemplando tanto al sector forestal, como los recursos utilizados para su aprovechamiento', 4, '1.4.4.1'),
	(164, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'Dentro de sus actividades que conlleva dentro del aprovechamiento del recurso forestal y teniendo en cuenta la normatividad vigente usted', 'Reconoce y aplica la normatividad ambiental vigente para el sector forestal, pero, aunque conoce la correspondiente a los recursos asociados al aprovechamiento no es aplicada en sus actividades', 3, '1.4.4.1'),
	(165, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'Dentro de sus actividades que conlleva dentro del aprovechamiento del recurso forestal y teniendo en cuenta la normatividad vigente usted', 'Reconoce la normatividad ambiental vigente, pero no la aplica a sus actividades de aprovechamiento forestal', 2, '1.4.4.1'),
	(166, 'GESTION SOSTENIBLE DE RECURSOS NATURALES', 'Dentro de sus actividades que conlleva dentro del aprovechamiento del recurso forestal y teniendo en cuenta la normatividad vigente usted', 'Desconoce la normatividad ambiental vigente', 1, '1.4.4.1'),
	(167, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Sobre la existencia de los mecanismos de participación sectorial usted', 'Reconoce los mecanismos e instancias de participación productiva y/o social, hace parte de junta directiva', 4, '1.5.1.1'),
	(168, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Sobre la existencia de los mecanismos de participación sectorial usted', 'Reconoce los mecanismos e instancias de participación productiva y/o social, hace parte como asociado o integrante', 3, '1.5.1.1'),
	(169, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Sobre la existencia de los mecanismos de participación sectorial usted', 'Aunque reconoce y conoce los mecanismos de participación, no se encuentra vinculado a ninguna de estas figuras', 2, '1.5.1.1'),
	(170, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Sobre la existencia de los mecanismos de participación sectorial usted', 'Desconoce los mecanismos e instancias de participación productivo y/o social, en los cuales puede interactuar', 1, '1.5.1.1'),
	(171, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Sobre los mecanismos de participación ciudadana usted como productor', 'Conoce y entiende el alcance de los mecanismos de participación establecidos, así como su aplicabilidad', 4, '1.5.1.2'),
	(172, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Sobre los mecanismos de participación ciudadana usted como productor', 'Conoce y entiende el alcance de los mecanismos de participación establecidos, pero no es claro su alcance y aplicabilidad', 3, '1.5.1.2'),
	(173, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Sobre los mecanismos de participación ciudadana usted como productor', 'Aunque conoce cuales son los mecanismos de participación establecidos, no es claro su alcance y aplicabilidad', 2, '1.5.1.2'),
	(174, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Sobre los mecanismos de participación ciudadana usted como productor', 'Desconoce los mecanismos de participación establecidos por la Ley', 1, '1.5.1.2'),
	(175, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Teniendo en cuenta las herramientas de participación establecidas (petición, quejas, denuncias, acción de tutela, acción popular y acción de cumplimiento) usted', 'Reconoce su alcance y aplicabilidad', 4, '1.5.2.1'),
	(176, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Teniendo en cuenta las herramientas de participación establecidas (petición, quejas, denuncias, acción de tutela, acción popular y acción de cumplimiento) usted', 'Reconoce sus alcances, pero no su aplicabilidad', 3, '1.5.2.1'),
	(177, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Teniendo en cuenta las herramientas de participación establecidas (petición, quejas, denuncias, acción de tutela, acción popular y acción de cumplimiento) usted', 'Reconoce las herramientas PERO desconoce su alcance y aplicabilidad', 2, '1.5.2.1'),
	(178, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Teniendo en cuenta las herramientas de participación establecidas (petición, quejas, denuncias, acción de tutela, acción popular y acción de cumplimiento) usted', 'Desconoce las herramientas de participación', 1, '1.5.2.1'),
	(179, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Ejercicio de control político y social', 'Entiende en que consiste el control social, así como las herramientas que lo permiten, su alcance y su aplicabilidad', 4, '1.5.3.1'),
	(180, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Ejercicio de control político y social', 'Entiende en que consiste el control social y conoce las herramientas con que se cuenta para realizarlo, pero desconoce su alcance y aplicabilidad', 3, '1.5.3.1'),
	(181, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Ejercicio de control político y social', 'Conoce que es el control social, pero desconoce las herramientas con que se cuenta para realizarlo', 2, '1.5.3.1'),
	(182, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Ejercicio de control político y social', 'Desconoce lo que es el control social y las herramientas con que se puede realizar', 1, '1.5.3.1'),
	(183, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Fomento de la autogestión de las comunidades', 'Están conformados como cooperativas de producción u otra figura asociativa formal', 4, '1.5.4.1'),
	(184, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Fomento de la autogestión de las comunidades', 'No se encuentran conformados legalmente bajo una figura asociativa, pero si se encuentran agrupados en la Junta de Acción Comunal (JAC), sin embargo, dentro de la comunidad existen actividades de trabajo social y recolección de recursos para intereses colectivos', 3, '1.5.4.1'),
	(185, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Fomento de la autogestión de las comunidades', 'Solo Cuenta con la vinculación a las Juntas de Acción Comunal, su junta directiva es la encargada de gestionar recursos y liderar procesos', 2, '1.5.4.1'),
	(186, 'DESARROLLO DE HABILIDADES PARA LA PARTICIPACION', 'Fomento de la autogestión de las comunidades', 'Se encuentran vinculados por la Junta de Acción Comunal, pero no presenta acciones de gestión', 1, '1.5.4.1');
